		},
		{
			label: 'Loja',
			icon: <ion-icon name="storefront-outline"></ion-icon>,
			subItens: null,
		}
	]

	return (
		<>
			<Calculator calculators={navigation[1].subItens} />
		</>
	);
}

export default App;
